      </div>
      <div className="option-box">
        <h1>Hata!</h1>
      </div>
      <div className="option-box">
        <p> Sepete Eklemek İçin Lütfen beden ve renk seçiniz </p>
      </div>
    </div>
  );
};

export default Alert;
